import React,{useState, useEffect} from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const URI = "http://localhost:8000/proyecto"

const ShowCataloPro = () => {

    const [dataCatPro, setDataCatPro] = useState([])

    const ConsultProyecAd = async () => {
        try{
            const req = await axios.get(URI)
            console.log(req.data)
            setDataCatPro(req.data)
        }catch(e){
            console.error(e)
        }
    }

    useEffect(() => {
        ConsultProyecAd()
    },[])

    return(
    <>
        <div className="divCont bg-blue-950 justify-center items-center h-screen">
        {dataCatPro.forEach((doc) => {
            <section className="gradient-form h-screen bg-neutral-200 dark:bg-neutral-700">
                <div className="grid grid-cols-1 gap-4 lg:grid-cols-5 lg:gap-8">
                    <div className="flex m-6 h-auto w-auto rounded-lg bg-gray-200">
                        <article className="hover:animate-background rounded-lg bg-gradient-to-r from-blue-700 via-blue-800 to-blue-900 p-0.5 shadow-xl transition hover:bg-[length:400%_400%] hover:shadow-sm hover:[animation-duration:_4s]">
                            <div className="rounded-[10px] bg-slate-950 p-4 !pt-20 sm:p-6">
                                <time dateTime="2022-10-10" className="block text-xs text-gray-500"> 10th Oct 2022 </time>
                                <a href="/">
                                    <h3 className="mt-0.5 text-lg font-medium text-slate-400">
                                        How to center an element using JavaScript and jQuery
                                    </h3>
                                </a>
                                <div className="mt-4 flex flex-wrap gap-1">
                                    <span
                                        className="whitespace-nowrap rounded-full bg-blue-950 px-2.5 py-0.5 text-xs text-slate-400"
                                    >
                                        Snippet
                                    </span>

                                    <span
                                        className="whitespace-nowrap rounded-full bg-blue-950 px-2.5 py-0.5 text-xs  text-slate-400"
                                    >
                                        JavaScript
                                    </span>
                                </div>
                            </div>
                        </article>
                    </div>
                </div>
            </section>
            })}
        </div>
    </>)
}

export default ShowCataloPro
